  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Medicare Coverage Database (MCD)
  contains all National Coverage Determinations (NCDs) and Local Coverage Determinations
  (LCDs), local articles, and proposed NCD decisions. The database also includes several
  other types of National Coverage policy related documents, including National Coverage
  Analyses (NCAs), Coding Analyses for Labs (CALs), Medicare Evidence Development
  and Coverage Advisory Committee (MEDCAC) proceedings, and Medicare coverage guidance
  documents.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
